{"result":"@-moz-document domain("lichess.org") {
  .round__app {
    display: flex;
    flex-direction: column;
  }
  .round__app .main-board {
    order: 2;
  }
  .round__app .underboard {
    order: 3;
  }
  .round__app .rcontrols {
    order: 4;
  }
  .round__app .rclock {
    order: 1;
    margin-bottom: -10px;
    margin-top: -10px;
    height: 50px;
    font-size: 30px;
    line-height: 50px;
    text-align: center;
    display: flex;
    justify-content: space-between;
  }
  .round__app .rclock > div {
    width: calc(50% - 20px);
    margin-left: 20px;
    margin-right: 20px;
    border-radius: 5px;
    box-shadow: inset 0px 0px 5px rgba(0,0,0,.3);
    background-color: rgba(255,255,255,.1);
  }
}"}
